import React from 'react';
import './App.css';
import Header from './components/layout/Header/Header';
import Wrapper from './components/layout/Content/Menu/Wrapper';
import { HeaderValueProvider } from './components/layout/Header/HeaderNavContext';



function App() {
  return (
    <>
      <HeaderValueProvider>
        <Header></Header>
        <Wrapper></Wrapper>
      </HeaderValueProvider>

    </>
  );
}

export default App;
